Chickadee.Models.Bird = Backbone.Model.extend({
  urlRoot: "/api/birds"
});
Chickadee.Models.Question = Backbone.Model.extend({
  url: "/api/quizzes/",

  initialize: function () {
    this.listenTo(this, "change", this.buildUrl)
  },

  buildUrl: function () {
    this.url = "/api/quizzes/" + this.id
  },

  answerChoices: function () {
    return _.shuffle([
      (this.get('correct_answer')),
      (this.get('answer_a')),
      (this.get('answer_b')),
      (this.get('answer_c'))
    ]);
  }
});
Chickadee.Models.Quiz = Backbone.Model.extend({
  urlRoot: "/api/quizzes",

  question: function(){
    if (!this._question) {
      this._question = new Chickadee.Models.Question();
    }
    return this._question;
  },

  parse: function(payload){
    if (payload.question) {
      this.question().set(payload.question);
      delete payload.question;
    }
    return payload;
  },
});
Chickadee.Models.Region = Backbone.Model.extend({
  urlRoot: "/api/regions",

  birds: function () {
    if (!this._birds) {
      this._birds = new Chickadee.Collections.Birds([], {region: this})
    }
    return this._birds;
  },

  parse: function (payload) {
    if (payload.birds) {
      this.birds().set(payload.birds);
      delete payload.birds;
    }
    return payload;
  },

  name: function () {
    var county = this.get('county');
    var state = this.get('state');
    var country = this.get('country')

    if (!state) {
      return country;
    } else if (!county) {
      return state + ", " + country;
    } else {
      return county + ", " + state + ", " + country;
    }
  }
});
Chickadee.Models.User = Backbone.Model.extend({
  urlRoot: "api/users",

  name: function () {
    if (this.get('alias')) {
      return this.get('alias');
    } else if (this.get('email')) {
      return this.get('email');
    } else {
      return "anonymous user";
    }
  },
});

Chickadee.Models.CurrentUser = Chickadee.Models.User.extend({
  url: "/api/session",

  initialize: function () {
    this.listenTo(this, "change", this.checkLoggedIn)
    this.firstTime = false;
  },

  isLoggedIn: function () {
    return !this.isNew();
  },

  login: function (credentials) {
    this.set(credentials);
    this.save({}, {
      success: function () {
        Backbone.history.navigate("regions", {trigger:true})
        this.trigger("loginSuccess")
      }.bind(this),
      error: function () {
        this.trigger("loginFail")
      }.bind(this)
    });
  },

  logout: function (callback) {
    var currentUser = this;
    $.ajax({
      url: "/api/session",
      method: 'DELETE',
      success: function() {
        currentUser.clear();
        this.trigger("logout");
        Backbone.history.navigate("", { trigger: true });
      }.bind(this)
    });
  },

  checkLoggedIn: function () {
    if (!this.isNew()) {
      this.trigger("login");
    } else {
      this.isLoggedIn() && this.trigger("logout");
    }
  }
});
Chickadee.Collections.Birds = Backbone.Collection.extend({
  initialize: function (options) {
    this.world = (options.world ? options.world : false)
  },

  model: Chickadee.Models.Bird,

  url: function () {
    return (this.world ? "/api/birds_all" : "/api/birds")
  },
});
Chickadee.Collections.Regions = Backbone.Collection.extend({
  model: Chickadee.Models.Region,
  url: "/api/regions",

  getOrFetch: function (region_id) {
    var model = this.get(region_id);
    var collection = this;

    if (!model) {
      model = new Chickadee.Models.Region({id: region_id});
      model.fetch({
        success: function () {
          collection.add(model, {merge: true});
        }
      });
    } else {
      model.fetch();
    }

    return model;
  }
});
