Chickadee.Views.QuizShow = Backbone.View.extend({
  initialize: function (options) {
    this.regionId = options.regionId;
    this.question = this.model.question();
    this.region = new Chickadee.Models.Region(this.model.get('region'));
    this.$el.append('<audio class="ping" src="correct-beep.mp3"></audio>')
    this.$el.append('<audio class="ping" src="incorrect-beep.mp3"></audio>')
  },

  tagName: "section",
  className: "quiz-show group",
  template: JST["quiz_show"],
  events: {
    "click .answer":"handleAnswer",
    "click .quiz-again":"quizAgain",
    "click .back-button":"goToIndex",
  },

  flashResult: function (correct, callback) {
    var resultStr = correct ? "correct" : "incorrect"
    var flash = JST[("answer_" + resultStr)]({bird: this.question.get('correct_answer')});
    var flashbox = this.$(".flash-box");
    flashbox.addClass(resultStr);
    this.$el.append('<audio class="ping" src="'+ resultStr +'-beep.mp3" autoplay></audio>');
    var view = this;
    flashbox.html(flash).hide().fadeToggle(400, function () {
      setTimeout(function () {
        flashbox.fadeToggle(600, "linear", function () {
          view.flashOver = true;
        });
      }, 1000)
    });
  },

  fadeToLoad: function () {
    var message = "Loading audio..."
    this.$(".fade-box").fadeOut(500, function () {
      this.$(".audio-box").html(JST["loading"]({message: message}));
      this.$(".spinner").attr("src", "../spinner-dark.gif");
      this.$(".audio-box").prepend("<br><br><br>")
    }.bind(this));
  },

  fillProgressBar: function () {
    this.model.get('history').forEach(function (answer, i) {
      var currentDot = (i + 1).toString();
      var $dot = this.$(".quiz-progress div:nth-last-child(" + currentDot + ")");
      $dot.removeClass();
      if (answer === "Y") {
        $dot.addClass("correct");
      } else if (answer === "N") {
        $dot.addClass("incorrect");
      } else {
        $dot.addClass("unanswered")
      }
    }.bind(this))
  },

  updateScore: function () {
    this.$(".quiz-score").html(parseInt(this.model.get('score')) + 1);
  },

  handleAnswer: function (event) {
    if (this.answered) {return}
    this.answered = true
    this.flashOver = false;

    var chosenId = $(event.currentTarget).data('id');
    var correctId = this.question.get('correct_answer').id;
    var correct = (correctId === chosenId ? true : false);

    this.fillProgressBar();
    correct && this.updateScore();
    this.flashResult(correct);

    this.fadeToLoad();

    this.question.save({correct: correct}, {
      success: function (model, response) {
        this.interval = window.setInterval(function () {
          if (this.flashOver) {
            this.nextQuestion(response);
            window.clearInterval(this.interval);
          }
        }.bind(this), 100);
      }.bind(this)
    });
  },

  nextQuestion: function (response) {
    this.model.set(this.model.parse(response));

    if (parseInt(response.progress) < 10) {
      this.question = this.model.question();
      this.answered = false;
      this.render();
    } else {
      this.answered = false;
      this.results();
    }
  },

  render: function () {
    var content = this.template({
      quiz: this.model,
      region: this.region,
      question: this.question,
    });

    this.$el.html(content);
    this.fillProgressBar();
    return this;
  },

  results: function () {
    var content = JST['quiz_results']({
      quiz: this.model,
      region: this.region
    });

    this.$el.html(content);
    this.renderGraph();
    return this;
  },

  quizAgain: function (event) {
    this.$el.fadeOut(300, function () {
      Backbone.history.loadUrl();
    });
  },

  goToIndex: function (event) {
    this.$el.fadeOut(300, function () {
      Backbone.history.navigate("regions", {trigger: true})
    });
  },

  renderGraph: function () {
    var data = this.model.get('xp_timeseries');
    // timeseries.forEach(function(xpPoints) {
    //   data.push({xp: parseInt(xpPoints)})
    // });
    console.log(data);
    var margin = {top: 30, right: 20, bottom: 30, left: 120},
        width = 500 - margin.left - margin.right,
        height = 220 - margin.top - margin.bottom;

    var x = d3.scale.linear().range([0, width]).domain([0, 6])

    var y = d3.scale.linear().range([height, 0])
              .domain([d3.min(data) - 20, d3.max(data)]);

    var xAxis = d3.svg.axis().scale(x).orient("bottom")
                  .ticks(6).tickSize(-5, 0).tickFormat('');
    var yAxis = d3.svg.axis().scale(y).orient("left")
                  .ticks(3).tickSize(-5, 0);

    var valueline = d3.svg.line()
                      .x(function(d, i) { return x(i); })
                      .y(function(d) { return y(d); })

    var svg = d3.select("#xp-chart")
                .append("svg")
                .attr("width", width + margin.left + margin.right)
                .attr("height", height + margin.top + margin.bottom)
                .append("g")
                .attr("transform",
                  "translate(" + margin.left + "," + margin.top + ")");

    svg.append("path")
        .attr("class", "line")
        .attr("d", valueline(data));

    svg.append("g")
        .attr("class", "x axis")
        .attr("transform", "translate(0," + height + ")")
        .call(xAxis);

    svg.append("g")
        .attr("class", "y axis")
        .call(yAxis);

    svg.selectAll(".tick")
       .filter(function (d) { return d === 0;  })
       .remove();

  }
})
;
Chickadee.Views.RegionForm = Backbone.View.extend({
  initialize: function (options) {
    this.subviews = []
    $.ajax({
      url: "api/countries",
      method: "GET",
      success: function (data) {
        this.countryList = data
        this.$el.find("#new-region-country").autocomplete({
          minLength: 3,
          source: this.countryList
        })
      }.bind(this)
    });
  },

  tagName: "form",
  className: "invisible centered-form",

  events: {
    "submit":"submitNewRegion",
    "click .back-button":"goToIndex",
    "click #new-region-state":"checkForCountry",
    "click #new-region-county":"checkForState"
  },

  template: JST["region_form"],

  render: function () {
    this.showSpinner = false
    this.removeSubviews()
    var content = this.template({region: this.model});
    this.$el.html(content);
    return this;
  },

  checkForCountry: function (event) {
    if (this.$("#new-region-country").val() == "") {
      $(event.currentTarget).val("Enter a country first!")
    }
  },

  checkForState: function (event) {
    if (this.$("#new-region-state").val() == "") {
      $(event.currentTarget).val("Enter a state first!")
    }
  },

  capitalizeRegion: function (region) {
    if (region["country"] != "") {
      region["country"] = this.capitalizeMostWords(region["country"]);
    }

    if (region["state"] === "Enter a country first!") {
      region["state"] = "";
    } else if (region["state"] != "") {
      region["state"] = this.capitalizeMostWords(region["state"]);
    }

    if (region["county"] === "Enter a state first!") {
      region["county"] = "";
    } else if (region["county"] != "") {
      region["county"] = this.capitalizeMostWords(region["county"]);
    }

    return region;
  },

  capitalizeMostWords: function (str) {
    var new_str = [];
    str.split(" ").forEach(function (word) {
      if (word != "and" && (word != "of" && word != "the")) {
        new_str.push(word[0].toUpperCase()
                     + word.substring(1, word.length).toLowerCase());
      }
    })
    return new_str.join(" ");
  },

  submitNewRegion: function (event) {
    event.preventDefault();
    var attr = $(event.currentTarget).serializeJSON();
    this.capitalizeRegion(attr["region"]);
    var view = this;
    view.showSpinner = true;

    var timer = setTimeout( function () {
      if (view.showSpinner) {
        this.$("fieldset").fadeOut(300, function () {
          view.$el.find(".spinner-box")
                  .html('<img class="spinner" src="spinner-light.gif">')
        });
      }
    }, 500);

    view.model.save(attr, {
      success: function () {
          clearTimeout(timer);
          Chickadee.Collections.regions.add(view.model);
          view.goToIndex();
      },
      error: function (model, response) {
        view.showSpinner = false;
        view.$("fieldset").fadeIn(300);
        view.displayErrors(response.responseJSON);
      }
    });
  },

  displayErrors: function (errors) {
    this.removeSubviews();
    var subview = new Chickadee.Views.Errors({errors: errors});
    this.subviews.push(subview)
    this.$el.find("p").append(subview.render().el)
    this.$el.find(".error-message").css('opacity', 0)
                                   .slideDown(300)
                                   .animate(
                                     { opacity: 1 },
                                     { queue: false, duration: 1000 }
                                    );
  },

  remove: function () {
    this.showSpinner = false;
    Chickadee.Views.RegionsIndex.prototype.remove.call(this);
  },

  removeSubviews: function () {
    this.subviews.forEach(function (subview) {
      subview.remove();
    });
    this.subviews = [];
  },

  goToIndex: function (event) {
    event && event.preventDefault();
    this.$el.fadeOut(300, function () {
      Backbone.history.navigate("regions", {trigger: true})
    });
  }
})
;
