Chickadee.Views.SignUp = Backbone.View.extend({

  template: JST["sign_up"],

  events: {
    "click .go-button":"submit"
  },

  tagName: "section",
  className: "modal-backdrop modal-backdrop-orange",

  render: function () {
    this.$el.html(this.template());
    this.$el.find(".login-error").hide();
    return this;
  },

  submit: function (event) {
    event.preventDefault();
    var data = this.$("form").serializeJSON();
    if (this.passwordsMatch(data)) {
      var view = this;
      $.ajax({
        url: "/api/users",
        method: 'POST',
        data: data,
        success: function(newUserData) {
          Chickadee.Models.currentUser.firstTime = true;
          Chickadee.Models.currentUser.login(data);
          view.remove();
        },
        error: function (response) {
          var errors = response.responseJSON;
          this.$(".login-error").empty();
          this.$(".login-error").append(errors[0] + ".");
          this.displayError();
        }.bind(this)
      });
    } else {
      this.$(".login-error").empty();
      this.$(".login-error").append("Passwords do not match.");
      this.displayError();
    }
  },

  passwordsMatch: function (data) {
    return data["user"]["password"] === data["user"]["confirm_password"];
  },

  displayError: function () {
    this.$(".login-error").fadeIn(300, function () {
      setTimeout(function () {
        this.$(".login-error").fadeOut(300);
      }.bind(this), 3000)
    }.bind(this));
  }
});
Chickadee.Views.UserProfile = Backbone.View.extend({
  initialize: function () {
    this.listenTo(this.model, "sync", this.render)
    this.$el.attr("enctype", "multipart/form-data")
  },

  events: {
    "click .back-button":"goToRegions",
    "change #user-image-input":"changeImage",
    "submit":"updateProfile"
  },

  template: JST["user_profile"],

  tagName: "form",
  className: "edit-profile centered-form",

  goToRegions: function (event) {
    event && event.preventDefault();
    this.$el.fadeOut(300, function () {
      Backbone.history.navigate("regions", {trigger: true})
    });
  },

  changeImage: function (event) {
    event.preventDefault();
    var file = event.currentTarget.files[0];

    var fileReader = new FileReader();
    var view = this;

    fileReader.onloadend = function () {
      view.model.set("image", fileReader.result);
      view.model.set("new_image", true);
      view.$(".user-image").attr("src", fileReader.result)
    };

    fileReader.readAsDataURL(file);
  },

  render: function () {
    var content = this.template({user: this.model});
    this.$el.html(content);
    return this;
  },

  updateProfile: function (event) {
    event.preventDefault();

    var view = this;
    var data = view.$el.serializeJSON();

    if (view.model.get('new_image')) {
      data.user.image = view.model.get('image')
    }


    $.ajax({
      method: "PATCH",
      url: "/api/users/" + view.model.id,
      data: data,
      success: function () {
        view.model.fetch();
        view.goToRegions();
      },
      error: function (model, response) {
        view.displayErrors(response.responseJSON);
      },
    });
    this.stopListening(this.model);
    this.$el.html(JST["loading"]({message: "Syncing your profile..."}))
  }
});
